import "./home.scss";
import React from 'react';
import Login from "../login/Login";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import SignUp from "../sign-up/SignUp";

const Home = () => {
  return (
    <div>
      <div className="home-wrapper">
        <div className="home-title">
          dboard
        </div>
          <Route path="/login" element={<Login></Login>}><button>로그인</button></Route>
          <Route path="/signup" element={<SignUp></SignUp>}><button>회원가입</button></Route>
      </div>
    </div>
  )
}

export default Home;
